trailingComments.value:
*
 * 根据书籍 ID 打开去投推荐票
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @return {Promise<void>}
 *
 * @example
 * libSQ.exec('vote-recommend-ticket', { params }).catch((err) => {
 *   alert(`[vote-recommend-ticket][error] ${JSON.stringify(err, null, 2)}`);
 *   const e = err.detail.__$rawError__;
 *   alert(e.message);
 *   alert(e.stack);
 * });

